    false,nt"url": null,nt"notes": "This EnviroAtlas dataset demonstrates the
    effect of changes in pollution concentration on local populations in 703 block groups
    in Memphis, Tennessee. The US EPA's Environmental Benefits Mapping and Analysis
    Program (BenMAP) was used to estimate the incidence of adverse health effects (i.e.,
    mortality and morbidity) and associated monetary value that result from changes
    in pollution concentrations for Crittenden County, AR, DeSoto County, MS, and Shelby
    County, TN. Incidence and value estimates for the block groups are calculated using
    i-Tree models (www.itreetools.org), local weather data, pollution data, and U.S.
    Census derived population data. This dataset was produced by the US Forest Service
    to support research and online mapping activities related to EnviroAtlas. EnviroAtlas
    (https://www.epa.gov/enviroatlas) allows the user to interact with a web-based,
    easy-to-use, mapping application to view and analyze multiple ecosystem services
    for the contiguous United States. The dataset is available as downloadable data
    (https://edg.epa.gov/data/Public/ORD/EnviroAtlas) or as an EnviroAtlas map service.
    Additional descriptive information about each attribute in this dataset can be found
    in its associated EnviroAtlas Fact Sheet (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).",nt"license_title":
